- input: "TEXT\x1CC00431429\x1C.TEXT\x1C\x1CF3XA\x1CI had to rebuild the July 2012
    Quarterly Report in order to submit the amended report, which corrects errors
    pointed out in the April 23, 2012 RFAI I received. A $5,000 disbursement to another
    political committee was incorrectly filed as a transfer to an affiliated committee.
    In the amended report, the total disbursement amounts in Line 23 in the summary
    page are now correct. Subsequent reports, including the October 2012 quarterly
    filing should now accurately reflect disbursements. I also amended disbursements
    that contained incorrect election codes. The disbursements were redesignated so
    that contributions to Chris Gibson, Frank Guinta and Maggie Brooks were accurately
    applied to the 2012 primary--not general--election. Please contact me with any
    questions.\n"
